import React from "react";
import "../App.css";
import TaskItem from "./TaskItem";

const TaskList = (props) => {
  const tasks = props.tasks;

  return (
    <table>
      <thead>
        <tr>
          <td>Id</td>
          <td>Name</td>
          <td>Deadline</td>
          <td>Status</td>
        </tr>
      </thead>
      <tbody>
        {tasks.map((task) => (
          <TaskItem
            key={task.id}
            id={task.id}
            name={task.taskName}
            deadline={task.deadline}
            status={task.status}
          />
        ))}
      </tbody>
    </table>
  );
};

export default TaskList;
